description.text:
RevB: Better orientation for printing. No support material needed. Place it in Replicator G with the intersection facing upwards, in a pryamid shape.
Inner Diameter: 16mm or about 5/8&quot;
Use this in conjuction with <a rel="nofollow" href="http://www.thingiverse.com/thing:11027" >http://www.thingiverse.com/thing:11027</a>.

An adjustable mount for the Replicator 2 to be used with a Gopro to record time-lapse videos of things printing!  
//EDIT 10/9/13: I re-uploaded the 'Mount Arm' STL because I encountered a problem while printing it. The problem should be fixed now, but I'll know for sure when I can re-print it.  
//EDIT 10/10/13: I'm going to have to re-upload both the 'Pin' and 'Mount Arm' STL files because the pin would not fit in the Adjustable Arm, so I made the pin smaller, and the slot on the Mount Arm wider.<br />
^Just finished printing the new pin and it's still a bit tight, but with a bit of wear it should be fine.  
//EDIT 10/24/13: Some people have been having issues with their camera case not fitting into the mount at the right angles, I have two solutions to this that I could implement... I could either re-design the model I made to be more giving in terms of adjustment of the camera, or I could take a few different cases and remix them to be able to be used with my design... I'll figure it out and fix the problem.<br />
^I took the easy way out and I changed the arm a bit, I've uploaded the new file, but I won't know if it works any better until I print it myself and see...
